import React from 'react';
import { Switch, Route } from 'react-router-dom'
import Home from './Home';


export const Router = () => {
    return (
        <>
            <Switch>
                <Route path='/' component={Home}></Route>
            </Switch>
        </>
    )
}

export default Router;
